import React from 'react';
import { 
  MDBCol, 
  MDBContainer, 
  MDBRow, 
  MDBCard,
  MDBCardText, 
  MDBCardBody, 
  MDBCardImage, 
  MDBBtn, 
  MDBBreadcrumb, 
  MDBBreadcrumbItem
} from 'mdb-react-ui-kit';

export default function AboutUsPage() {
  const teamMembers = [
    {
      name: 'John Doe',
      title: 'CEO',
      image: 'https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava1.webp',
      description: 'John is the founder and CEO of our company. He has over 10 years of experience in the industry.'
    },
    {
      name: 'Jane Smith',
      title: 'CTO',
      image: 'https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava2.webp',
      description: 'Jane is our CTO and is responsible for the technical direction of the company. She has a Ph.D. in Computer Science.'
    },
    {
      name: 'Jim Brown',
      title: 'COO',
      image: 'https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava3.webp',
      description: 'Jim is our COO and is responsible for the day-to-day operations of the company. He has an MBA from Stanford.'
    },
    {
      name: 'Jake White',
      title: 'CFO',
      image: 'https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava4.webp',
      description: 'Jake is our CFO and is responsible for the financial management of the company. He is a CPA and has a degree in Finance.'
    },
    {
      name: 'Jill Black',
      title: 'CMO',
      image: 'https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava5.webp',
      description: 'Jill is our CMO and is responsible for the marketing and branding of the company. She has a degree in Marketing and over 5 years of experience in the field.'
    },
  ]

  return (
    <MDBContainer>
      <MDBBreadcrumb>
        <MDBBreadcrumbItem>
          <a href='#'>Home</a>
        </MDBBreadcrumbItem>
        <MDBBreadcrumbItem active>About Us</MDBBreadcrumbItem>
      </MDBBreadcrumb>
      <MDBRow>
        {teamMembers.map((member, index) => (
          <MDBCol lg="4" className="mb-4" key={index}>
            <MDBCard>
              <MDBCardImage
                src={member.image}
                alt={member.name}
                top
                className="rounded-0"
              />
              <MDBCardBody>
                <MDBCardText>{member.name}</MDBCardText>
                <MDBCardText>{member.title}</MDBCardText>
                <MDBCardText>{member.description}</MDBCardText>
              </MDBCardBody>
            </MDBCard>
          </MDBCol>
        ))}
      </MDBRow>
    </MDBContainer>
  );
}
